import React from "react"
export default class UserSelect extends React.Component{
    constructor(props){
        super(props)
        this.state={
            default:"selected",
            valueStart:"",
            valueEnd:"",
        }
    }
    render(){
        return(
            <div className="dateselect">
                <span className="date" >日期选择</span>
                {/*  接父组件传来的值*/}
                <div className="dateshow1">{this.props.value1}</div>
                {/* 接父组件传来的函数调用 */}
                <input type="date" className="date1" data-selcet="年-月-日" onChange={this.props.change1}/>
                <span className="minus">-</span>
                {/*  接父组件传来的值*/}
                <div className="dateshow2"> {this.props.value2}</div>
                {/*  接父组件传来的函数调用*/}
                <input type="date" className="date2" data-selcet="年-月-日" onChange={this.props.change2}/>
            </div>
        )
    }
}
